import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

const FooterContainer = styled.footer`
  background-color: ${props => props.theme.colors.secondary};
  color: ${props => props.theme.colors.white};
  padding: 3rem 0;
  margin-top: 4rem;
`;

const FooterContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 2rem;
`;

const FooterSection = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1rem;
`;

const FooterTitle = styled.h3`
  font-size: 1.2rem;
  margin-bottom: 1rem;
  color: ${props => props.theme.colors.white};
`;

const FooterLink = styled(Link)`
  color: ${props => props.theme.colors.textLight};
  transition: color ${props => props.theme.transitions.default};

  &:hover {
    color: ${props => props.theme.colors.white};
  }
`;

const FooterText = styled.p`
  color: ${props => props.theme.colors.textLight};
  line-height: 1.6;
`;

const SocialLinks = styled.div`
  display: flex;
  gap: 1rem;
`;

const SocialLink = styled.a`
  color: ${props => props.theme.colors.textLight};
  font-size: 1.5rem;
  transition: color ${props => props.theme.transitions.default};

  &:hover {
    color: ${props => props.theme.colors.white};
  }
`;

const Copyright = styled.div`
  text-align: center;
  margin-top: 3rem;
  padding-top: 2rem;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  color: ${props => props.theme.colors.textLight};
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <FooterSection>
          <FooterTitle>About BrainyMath</FooterTitle>
          <FooterText>
            Making mathematics education accessible, enjoyable, and effective for learners of all ages and abilities.
          </FooterText>
          <SocialLinks>
            <SocialLink href="https://twitter.com/brainymath" target="_blank" rel="noopener noreferrer">
              𝕏
            </SocialLink>
            <SocialLink href="https://facebook.com/brainymath" target="_blank" rel="noopener noreferrer">
              f
            </SocialLink>
            <SocialLink href="https://instagram.com/brainymath" target="_blank" rel="noopener noreferrer">
              📸
            </SocialLink>
          </SocialLinks>
        </FooterSection>

        <FooterSection>
          <FooterTitle>Quick Links</FooterTitle>
          <FooterLink to="/lessons">Lessons</FooterLink>
          <FooterLink to="/games">Games</FooterLink>
          <FooterLink to="/groups">Study Groups</FooterLink>
          <FooterLink to="/about">About Us</FooterLink>
        </FooterSection>

        <FooterSection>
          <FooterTitle>Resources</FooterTitle>
          <FooterLink to="/blog">Blog</FooterLink>
          <FooterLink to="/help">Help Center</FooterLink>
          <FooterLink to="/privacy">Privacy Policy</FooterLink>
          <FooterLink to="/terms">Terms of Service</FooterLink>
        </FooterSection>

        <FooterSection>
          <FooterTitle>Contact Us</FooterTitle>
          <FooterText>
            Email: support@brainymath.com<br />
            Phone: (555) 123-4567<br />
            Address: 123 Math Street, Education City
          </FooterText>
        </FooterSection>
      </FooterContent>

      <Copyright>
        © {new Date().getFullYear()} BrainyMath. All rights reserved.
      </Copyright>
    </FooterContainer>
  );
};

export default Footer;
